import { useEffect, useState } from "react";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LoginForm from './components/LoginForm';

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/" component={LoginForm} />
          {/* 다른 라우트 설정 */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
